VALUES
	(5,'泽海体态管理-文胸','泽海健康体态管理品牌系列内衣旨在为现代女性提供专业、时尚、高品质的具有形体管理功能的内衣选择。我们的品牌定位注重于健康穿戴、形体管理等品质，满足不同年龄段有形体管理需求的女性。',7,7,'内衣',1,0,0,0,'N;','N;','/uploadfiles/users/image/07597746905822192983.png',NULL,'&lt;p&gt;\n	&lt;img src=&quot;/uploadfiles/users/image/07597767895139922692.png&quot; alt=&quot;/uploadfiles/users/image/07597767895139922692.png&quot; /&gt; \n&lt;/p&gt;\n&lt;p&gt;\n	&lt;br /&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;/uploadfiles/users/image/07597965608322780006.png&quot; alt=&quot;/uploadfiles/users/image/07597965608322780006.png&quot; /&gt; \n&lt;/p&gt;\n&lt;p&gt;\n	【泽海韵】健康功能内衣采用高品质面料，结合先进的工艺技术，为您打造贴身舒适、透气性好、兼容性十足的内衣。我们注重每一个细节，从款式设计到颜色搭配，都经过精心挑选，以满足不同女性的个性化需求。我们的内衣采用独特的多层结构，能够有效地提升胸部，塑造优美曲线。同时，内衣的特殊材质能够起到支撑作用，减轻胸部下垂的现象，让您时刻保持自信挺拔的姿态。\n&lt;/p&gt;',1,1689044164,NULL,1099.00,0,'ZHY.C03H',0.00,0,0,0,0,'100','a:7:{i:6;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:5;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:4;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:3;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:2;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:7;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:1;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}}',NULL,0.00,1,1,1,'/uploadfiles/users/file/07597822112353985429.mp4','/uploadfiles/users/image/07597767895139922692.png',0,120,0.83,11,1099.00,0,0,0,0,0,1099.00,0,0.00),
	(7,'泽海体态管理-美体衣','塑造魅力曲线，展现迷人风采',8,8,'塑身衣',1,0,0,0,'N;','N;','/uploadfiles/users/image/07597743923933387532.png',NULL,'&lt;p&gt;\n	&lt;img src=&quot;/uploadfiles/users/image/07597743923933387532.png&quot; alt=&quot;/uploadfiles/users/image/07597743923933387532.png&quot; /&gt; \n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;/uploadfiles/users/image/07597833507600069656.png&quot; alt=&quot;/uploadfiles/users/image/07597833507600069656.png&quot; /&gt; \n&lt;/p&gt;\n&lt;p&gt;\n	塑造魅力曲线，展现迷人风采——健康功能性塑身衣\n&lt;/p&gt;\n想要拥有完美的身材，却总是被日常生活中的忙碌和压力所困扰？别担心，我们为你带来了健康功能性塑身衣，让你在繁忙的生活中也能轻松塑造迷人曲线！&lt;br /&gt;\n这款塑身衣采用高品质面料，结合人体工程学设计，能够贴合身体曲线，有效提升胸部、收束腰部、紧致腹部，同时改善臀部线条。它还融入了健康功能，让你在穿着倍感舒适的同时还能轻松的收获健康和美丽。&lt;br /&gt;\n现在，是时候告别那些让你困扰的赘肉和松垮的衣物了。选择健康功能性塑身衣，让你在自信中绽放魅力，成为众人瞩目的焦点。别再犹豫了，快来试试吧！&lt;br /&gt;\n&lt;div&gt;\n	&lt;br /&gt;\n&lt;/div&gt;',1,1689044773,NULL,2199.00,0,'ZHY.S03H',0.00,0,0,0,0,'100','a:7:{i:6;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:5;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:4;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:3;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:2;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:7;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:1;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}}',NULL,0.00,1,1,9999,'/uploadfiles/users/file/07597834331783727040.mp4','/uploadfiles/users/image/07597743923933387532.png',0,10,9.50,5,2199.00,0,0,0,0,0,2199.00,0,0.00),
	(8,'泽海体态管理-文胸','泽海健康体态的内衣采用独特的多层结构，能够有效地提升胸部，塑造优美曲线。同时，内衣的特殊材质能够起到支撑作用，减轻胸部下垂的现象，让您时刻保持自信挺拔的姿态。',7,7,'内衣',1,0,0,0,'N;','N;','/uploadfiles/users/image/07597768131997825528.png',NULL,'&lt;p&gt;\n	&lt;img src=&quot;/uploadfiles/users/image/07597768131997825528.png&quot; alt=&quot;/uploadfiles/users/image/07597768131997825528.png&quot; /&gt; \n&lt;/p&gt;\n&lt;p&gt;\n	&lt;img src=&quot;/uploadfiles/users/image/07598527837283829029.png&quot; alt=&quot;/uploadfiles/users/image/07598527837283829029.png&quot; /&gt; \n&lt;/p&gt;\n&lt;p&gt;\n	泽海健康体态功能内衣采用高品质面料，结合先进的工艺技术，为您打造贴身舒适、透气性好、拥有多种健康和美丽功能的内衣。\n&lt;/p&gt;\n&lt;p&gt;\n	我们注重每一个细节，从款式设计到颜色搭配，都经过精心挑选，以满足不同女性的个性化需求。\n&lt;/p&gt;\n我们的内衣采用独特的多层结构，能够有效地提升胸部，塑造优美曲线。同时，内衣的特殊材质能够起到支撑作用，减轻胸部下垂的现象，让您时刻保持自信挺拔的姿态。&lt;br /&gt;',1,1689051047,NULL,1099.00,0,'ZHY.C03F',0.00,0,0,0,1,'100','a:7:{i:6;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:5;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:4;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:3;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:2;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:7;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:1;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}}',NULL,0.00,1,1,2,'/uploadfiles/users/file/07597841327578577130.mp4','/uploadfiles/users/image/07597768131997825528.png',0,0,0.00,0,1099.00,0,0,0,0,0,1099.00,0,0.00),
