	(40,'美胸管理内衣套（C07款）','泽海健康体态管理品牌系列内衣旨在为现代女性提供专业、时尚、高品质的具有形体管理功能的内衣选择。我们的品牌定位注重于健康穿戴、形体管理等品质，满足不同年龄段有形体管理需求的女性。',12,12,'体验官系列',1,0,0,0,'N;','N;','/uploadfiles/users/image/08162213445411164273.jpg',NULL,'',1,1762874417,NULL,1319.00,0,'ZHY.C07',0.00,0,0,0,1,'100','a:7:{i:6;a:3:{i:0;s:5:&quot;22.75&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:5;a:3:{i:0;s:5:&quot;22.75&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:4;a:3:{i:0;s:5:&quot;22.75&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:3;a:3:{i:0;s:1:&quot;v&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:2;a:3:{i:0;s:5:&quot;22.75&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:7;a:3:{i:0;s:5:&quot;22.75&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:1;a:3:{i:0;s:5:&quot;11.38&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}}',NULL,0.00,0,0,9999,'','',0,0,0.00,5,1319.00,0,0,0,0,0,1319.00,1,15.17),
	(41,'泽海体态管理-文胸','泽海健康体态管理品牌系列内衣旨在为现代女性提供专业、时尚、高品质的具有形体管理功能的内衣选择。我们的品牌定位注重于健康穿戴、形体管理等品质，满足不同年龄段有形体管理需求的女性。',7,7,'内衣',1,0,0,0,'N;','N;','/uploadfiles/users/image/08162191783522549139.jpg',NULL,'&lt;p&gt;\n	&lt;img src=&quot;/uploadfiles/users/image/08162192922413957020.jpg&quot; alt=&quot;/uploadfiles/users/image/08162192922413957020.jpg&quot; /&gt;\n&lt;/p&gt;\n&lt;p&gt;\n	【泽海韵】健康功能内衣采用高品质面料，结合先进的工艺技术，为您打造贴身舒适、透气性好、兼容性十足的内衣。我们注重每一个细节，从款式设计到颜色搭配，都经过精心挑选，以满足不同女性的个性化需求。我们的内衣采用独特的多层结构，能够有效地提升胸部，塑造优美曲线。同时，内衣的特殊材质能够起到支撑作用，减轻胸部下垂的现象，让您时刻保持自信挺拔的姿态。\n&lt;/p&gt;',1,1762875391,NULL,899.00,0,'ZHY.C07',0.00,0,0,0,1,'100','a:7:{i:6;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:5;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:4;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:3;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:2;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:7;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}i:1;a:3:{i:0;s:1:&quot;0&quot;;i:1;s:1:&quot;0&quot;;i:2;s:1:&quot;0&quot;;}}',NULL,0.00,0,0,9999,'','',0,0,0.00,0,899.00,0,0,0,0,0,899.00,0,0.00),
